import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AuthGuard } from './guard/auth.guard';
import { AdminGuard } from './guard/admin.guard';

const routes: Routes = [
  {path: 'car-rental-platform', loadChildren: () => import('./main/main.module').then(m => m.MainModule), pathMatch: "full", canActivate: [AuthGuard]},
  {path: 'admin', loadChildren: () => import('./admin/admin.module').then(m => m.AdminModule), pathMatch: "full", canActivate: [AuthGuard, AdminGuard]},
  {path: '', loadChildren: () => import('./public/public.module').then(m => m.PublicModule), pathMatch: "full"},
  {path: '**', redirectTo: ''}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
